import React from 'react';
import { Container, Header, NumKey, NumPad, Title } from './style';

const Calculator: React.FC = () => {
	return (
		<Container>
			<Header>
				<Title>C</Title>
			</Header>
			<NumPad>
				<NumKey>1</NumKey>
				<NumKey>1</NumKey>
				<NumKey>1</NumKey>
				<NumKey>1</NumKey>
				<NumKey>1</NumKey>
				<NumKey>1</NumKey>
				<NumKey>1</NumKey>
			</NumPad>
		</Container>
	);
};

export default Calculator;
